INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(1, '2020-04-30', 'Le concours Castor', '\"Ce concours international est organisé directement au sein des établissements scolaires des pays participants. Il ne s\'agit pas d\'un concours de programmation (aucun prérequis n\'est nécessaire pour participer) mais il couvre divers aspects de l\'informatique : information et représentation, pensée algorithmique, utilisation des applications, structures de données, jeux de logique, informatique et société.\r\n\r\nEn France, le concours est organisé conjointement par France-ioi, Inria et l\'ENS Cachan. Il a lieu sur internet au mois de novembre chaque année depuis 2011. Il est réservé aux collégiens et lycéens, mais les sujets sont donnés en accès public peu après le concours et toutes les annales peuvent être résolues en ligne dans les même conditions que le concours original. \"', 401, , 1, 0, 0);
INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(2, '2020-05-02', 'Le concours Algoréa', '\"Le concours Algoréa est un concours de programmation gratuit, et ouvert à tous. Les élèves français ou résidant en France et scolarisés du CM1 à la 1re ont la possibilité de se qualifier pour un stage (fin août) sur Paris qui se conclut par une grande finale.\r\n\r\nPour se qualifier au premier tour, il faut soit être parmi les 10 % meilleurs au concours Castor, soit résoudre au moins 12 exercices de programmation sur le site. Il n\'est pas nécessaire de savoir programmer pour la première épreuve, dont le format est proche de celui du Castor. \"', 401, , 1, 0, 0);
INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(4, '2020-05-13', 'Le concours FARIO ', 'Le FARIO est un concours franco-australien organisé chaque année en mars depuis 2004 par France-ioi et l\'Australian Informatics Olympiad Committee (AIOC), entre les candidats des deux pays. Le FARIO est généralement constitué d\'une épreuve de 4 problèmes d\'algorithmique, à résoudre en 4 h. Le niveau y est élevé, de difficulté comparable aux autres olympiades régionales (voir ci-dessous).\r\n\r\nSi vous êtes français et collégien ou lycéen, il faut passer par France-ioi pour s\'inscrire à ce concours. Un bon niveau est cependant nécessaire. ', 401, , 1, 0, 0),
(5, '2020-06-23', 'Les IOI : Olympiades internationales d\'informatique ', 'Le grand concours d\'informatique pour lequel France-ioi a mis en place ce site internet afin de former les collégiens et lycéens français. Une page dédiée leur est consacrée. ', 401, '', 1, 0, 0),
(7, '2020-07-07', 'Croatian Open Competition in Informatics (COCI) ', 'La Croatian Open Competition in Informatics (COCI) est une série d\'épreuves de programmation auxquelles on peut participer dans les langages C, C++, Python, Pascal, et Java. Cette compétition existe depuis une dizaine d\'années et nécessite un bon niveau en algorithmique. L\'association France-ioi se charge, comme pour les concours USACO, de la traduction en français des énoncés. ', 401, , 1, 0, 0),
(8, '2020-07-15', 'Central European Olympiad in Informatic (CEOI) ', 'Les Central European Olympiad in Informatics (CEOI) regroupent chaque année les pays d\'Europe centrale (Autriche, Croatie, République Tchèque, Hongrie, Pologne, Roumanie, République slovaque, Slovénie), et parfois d\'autres, comme la France en 2005. ', 401, , 1, 0, 0),
(9, '2020-06-30', 'Balkan Olympiad in Informatics', 'Les Balkan Olympiad in Informatics (BOI) regroupent chaque année les pays de l\'Europe des Balkans (Albanie, Bosnie-Herzégovine, Bulgarie, Chypre, Grèce, Macédoine, République de Moldavie, Roumanie, Serbie-et-Monténégro, Turquie). ', 401, , 1, 0, 0);
INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(11, '2020-07-05', 'Prologin ', 'Prologin est un concours français destiné aux moins de 20 ans. Il est composé de trois étapes : une sélection à distance par un questionnaire de culture informatique et d\'algorithmique, des demi-finales régionales, et une finale de 36 h de fun, où les participants doivent programmer la stratégie d\'un champion pour un jeu dont les règles sont nouvelles chaque année. ', 401, , 1, 0, 0),
(12, '2020-09-15', 'L\'ACM International Collegiate Programming Contest (ICPC) ', 'L\'ACM International Collegiate Programming Contest (ICPC) est un concours très prestigieux organisé tous les ans pour des étudiants après le bac. Des équipes de trois étudiants représentant leur école participent d\'abord à une compétition régionale (regroupant la France, l\'Italie, le Portugal, l\'Espagne, l\'ouest de l\'Autriche, l\'ouest de l\'Allemagne, et la Suisse). Ensuite, les deux ou trois meilleures équipes gagnent une place à la finale mondiale. Étant donné le nombre, l\'entraînement et la motivation des participants, le niveau y est très élevé. En particulier, un bon nombre de candidats qui arrivent en finale sont des anciens médaillés des IOI. ', 401, , 1, 0, 0);
INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(13, '2020-10-23', 'Top Coder', 'Top Coder organise des concours en ligne toute l\'année. La vitesse et une bonne connaissance des algorithmes classiques est indispensable pour être bien classé (bien plus indispensable qu\'aux IOI).', 401, , 1, 0, 0),
(14, '2020-08-28', 'Google Code Jam', 'Google Code Jam est un concours organisé selon des rounds successifs, avec des problèmes d\'algorithmique à résoudre très vite. Les meilleurs sont invités à participer à la finale mondiale. ', 401, , 1, 0, 0),
(15, '2020-10-20', 'CodeForces', 'CodeForces propose de nombreux exercices et organise régulièrement des concours de programmation faisables en ligne. ', 401, , 1, 403, 0),
(16, '2020-09-25', 'Google Hash Code', 'Google Hash Code est une compétition de programmation, reservée aux personnes majeures, où l\'objectif est d\'obtenir le meilleur résultat possible sur des problèmes créés par les ingénieurs de Google. Il est possible de concourir dans le langage de programmation de son choix et les meilleurs sont récompensés par des prix.', 401, , 1, 0, 0),
(17, '2020-09-01', 'Primers', 'Primers est un site dédié aux problèmes d\'optimisation algorithmique approchée. Un classement est fait pour chacun des exercices proposés en fonction des scores obtenus par chacune des solutions proposées. Résoudre des exercices sur ce site est un très bon moyen de s\'entraîner pour la Google Hash Code.', 401, , 3, 0, 0);
INSERT INTO `concours` (`ccs_ID`, `date_css`, `nom_ccs`, `description_ccs`, `statutcss`, `image_css`, `Recruteur_ID`, `statutccs`, `statut_css`) VALUES
(18, '2020-08-19', 'CodeChef', 'CodeChef est une plateforme proposant de nombreux exercices et organise, chaque mois, des concours que l\'on peut faire dans le langage de programmation que l\'on veut.', 401, , 1, 403, 0);
